import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function EventsPage() {
  const [eventData, setEventData] = useState();

  useEffect(() => {
    async function fetchData() {
      const response = await fetch("http://localhost:8080/events", { method: "GET" });
      const resData = await response.json();

      if (!response.ok) {
        throw new Error("가져오기 실패 ㅋ");
      }

      setEventData(resData.events);
    }

    fetchData();
  }, []);

  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {eventData &&
          eventData.map((event) => (
            <li key={event.id}>
              <Link to={event.id}>{event.id}</Link>
            </li>
          ))}
      </ul>
    </>
  );
}
export default EventsPage;
